e-block;width:1.5em}.elementor-accordion .elementor-tab-title .elementor-accordion-icon svg{width:1em;height:1em}.elementor-accordion .elementor-tab-title .elementor-accordion-icon.elementor-accordion-icon-right{float:right;text-align:right}.elementor-accordion .elementor-tab-title .elementor-accordion-icon.elementor-accordion-icon-left{float:left;text-align:left}.elementor-accordion .elementor-tab-title .elementor-accordion-icon .elementor-accordion-icon-closed{display:block}.elementor-accordion .elementor-tab-title .elementor-accordion-icon .elementor-accordion-icon-opened,.elementor-accordion .elementor-tab-title.elementor-active .elementor-accordion-icon-closed{display:none}.elementor-accordion .elementor-tab-title.elementor-active .elementor-accordion-icon-opened{display:block}.elementor-accordion .elementor-tab-content{display:none;padding:15px 20px;border-top:1px solid #d5d8dc}@media (max-width:767px){.elementor-accordion .elementor-tab-title{padding:12px 15px}.elementor-accordion .elementor-tab-title .elementor-accordion-icon{width:1.2em}.elementor-accordion .elementor-tab-content{padding:7px 15px}}.e-con-inner>.elementor-widget-accordion,.e-con>.elementor-widget-accordion{width:var(--container-widget-width);--flex-grow:var(--container-widget-flex-grow)}</style>		\n												<a tabindex=\"0\">Conheça nosso trabalo</a>\n					<p>Atualmente, a Vixe trabalha com toda a produção de audiovisual do projeto <em>Meu Barraco, Minha Vida</em> – do Youtuber Gerson Albuquerque – que conta com mais de 8 milhões de inscritos em seu canal. </p><p>O projeto, que teve início em Abril de 2023, já teve vários vídeos produzidos pela nossa equipe, incluindo os episódios e vídeos de making of. Os vídeos já acumulam milhões de visualizações no Youtube e são produzidos e editados com equipamentos e profissionais altamente capacitados. </p>\n												<a tabindex=\"0\">Sanfona #2</a>\n					Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.\n															<img width=\"1024\" height=\"281\" src=\"http://localhost/oXE/wordpress/wp-content/uploads/2023/08/Ativo-22@2x.png\" alt=\"\" loading=\"lazy\" />', 'Elementor #8', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2023-08-15 23:20:00', '2023-08-16 02:20:00', '', 8, 'http://localhost/oXE/wordpress/?p=59', 0, 'revision', '', 0);
